function find(uid,gid){
    const hash_index = uid % 10;
    const src = gift_hash[hash_index];
    for(let i in src){
        if(src[i].uid === uid && src[i].gid === gid){
            return [ hash_index , i ];
        }
    }
    return [ hash_index , false ];
}

